import styled from "styled-components";
import CheckBox from "./CheckBox";
import { OneTodoItem } from "../model/Todo";
import Text from "./Text";
import { useState } from "react";

interface OneTodoProps {
  todo: OneTodoItem;
  onCheckBox: (id: number) => void;
}

const OneTodo: React.FC<OneTodoProps> = ({ todo }) => {
  const { text, checked, onCheckBox } = todo;

  return (
    <S.Wrapper>
      <CheckBox checked={checked} onCheckBox={onCheckBox} />
      <Text children={text} checked={checked} />
    </S.Wrapper>
  );
};
export default OneTodo;
const Wrapper = styled.div`
  display: flex;
  width: 100%;
  height: 30px;
  padding-top: 10px;
  border-bottom: 2px solid #0e9aa4;
`;

const S = { Wrapper };
